function Runner(){this.run=function(e){var n=this;HTMLCS.process(e,document,function(){var e=HTMLCS.getMessages();e.forEach(function(e,t,o){e.elementString=e.element.outerHTML,n.output(e)}),console.log("done")})},this.output=function(e){var n="UNKNOWN";switch(e.type){case HTMLCS.ERROR:n="ERROR";break;case HTMLCS.WARNING:n="WARNING";break;case HTMLCS.NOTICE:n="NOTICE"}var t=n+"|"+e.code+"|"+e.msg+"|"+e.elementString+"|"+e.element.className+"|"+e.element.id;console.log(t)}}var HTMLCS_RUNNER=new Runner;